import { generateUtilityClass, generateUtilityClasses } from '../className';
export function getMenuListUtilityClass(slot) {
  return generateUtilityClass('JoyMenuList', slot);
}
const menuClasses = generateUtilityClasses('JoyMenuList', ['root', 'nested', 'sizeSm', 'sizeMd', 'sizeLg', 'colorPrimary', 'colorNeutral', 'colorDanger', 'colorInfo', 'colorSuccess', 'colorWarning', 'variantPlain', 'variantOutlined', 'variantSoft', 'variantSolid']);
export default menuClasses;
